// App.js
import React from 'react';
import LoginForm from './components/LoginForm'; // Adjust the path as necessary

const App = () => {
  // This is the handleLogin function that will be called on form submission
  const handleLogin = async (username, password) => {
    try {
      const response = await fetch('/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ username, password }),
      });

      const data = await response.json();

      if (response.ok) {
        // Login successful
        console.log('Login successful:', data);
        // Here you can handle redirection or state updates as needed
      } else {
        // Login failed
        console.error('Login failed:', data.message);
        // Here you can handle error messages or state updates as needed
      }
    } catch (error) {
      // Network or other error
      console.error('Error:', error);
      // Here you can handle error messages or state updates as needed
    }
  };

  return (
    <div>
      <h1>Login Page</h1>
      <LoginForm onLogin={handleLogin} />
    </div>
  );
};

export default App;
